import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M8 12a2 2 0 11-4 0 2 2 0 014 0z", fill: primaryFill }),
        React.createElement("path", { d: "M14 12a2 2 0 11-4 0 2 2 0 014 0z", fill: primaryFill }),
        React.createElement("path", { d: "M18 14a2 2 0 100-4 2 2 0 000 4z", fill: primaryFill }));
};
const MoreHorizontal24Filled = wrapIcon(rawSvg({}), 'MoreHorizontal24Filled');
export default MoreHorizontal24Filled;
